import React from 'react';
import './PetInteraction.css'; // Add CSS for animation

function PetInteraction() {
  const handlePetClick = () => {
    alert('The pets are dancing!');
  };

  return (
    <div className="pet-interaction">
      <h2>Interactive Pets</h2>
      <img
        className="pet-image"
        src="/path/to/tobi.jpg"
        alt="Tobi"
        onClick={handlePetClick}
      />
      <img
        className="pet-image"
        src="/path/to/hachi.jpg"
        alt="Hachi"
        onClick={handlePetClick}
      />
    </div>
  );
}

export default PetInteraction;
